import { BrowserRouter, Routes } from "react-router-dom"
import App from "./App"
import FormComponent from "./components/FormComponent"

const MyRoute = () =>{
    return(
        <BrowserRouter>
            <div>
                <Routes path="/" Component={App}/>
                <Routes path="/create" exact Component={FormComponent}/>
            </div>
        </BrowserRouter>
    )
}
export default MyRoute;
